Add ``"django.contrib.auth.context_processors.auth"`` to the ``context_processors``.

```
TEMPLATES = [
    {
        'BACKEND': 'django.template.backends.django.DjangoTemplates',
        'APP_DIRS': True,
        'OPTIONS': {
            'context_processors': [
                "django.contrib.auth.context_processors.auth",
                ...
            ],
        },
    },
]
```

The following is incorrect:
```
{% if var1 %}
    foo
{% else %}
{% if var2 %}
    bar
{% endif %}
```

All `if`s must be ended with `endif`. Thus the correct is:
```
{% if var1 %}
    foo
{% elif var2 %}
    bar
{% endif %}
```
Or (depends on desired behavior):
```
{% if var1 %}
    foo
{% endif %}
{% if var2 %}
    bar
{% endif %}
```
